import { Routes } from '@angular/router';

export const APP_ROUTES: Routes = [
  {
    path: 'welcome',
    loadChi: () => import('./home/home.page').then((m) => m.HomePage),
  },
  {
    path: '',
    redirectTo: 'home',
    pathMatch: 'full',
  },
];
